import { getUsers } from '../../store/actions/allUsersAction';
import { User } from '../../types/allUsersTypes';
import './UserList.css';

const UserList: React.FC = () => {

    
    const dispatch = useAppDispatch();
  const userList = useSelectorTyped((state: any) => state.allUsers);
  
  sotrUser(userList)

    useEffect(() => {
      async function fetchData() {
        setTimeout(async () => {
          const result = await fetchUsers()
          dispatch(getUsers(result.items));
     
          },10000)
         
        }
        fetchData();
      }, [dispatch]);
    


    return (
        <section className='user-list'>
        {userList.map((user:User) => {
          return <div>
            <img src={user.avatarUrl} alt='avatar'/>
            <p>{user.firstName}</p>
            <p>{user.lastName}</p>
            <p>{ user.userTag}</p>
            <p>{ user.department}</p>
             </div>
     
           })} 
        </section>
    );
};

export default UserList;

